Este poema pertenece a Gabriel Celaya (cuyo nombre real era Rafael Múgica Alberti), un importante poeta español del siglo XX, conocido por su poesía social y comprometida. El poema "Carta en Noviembre" muestra su característico estilo descriptivo y emotivo, con referencias a paisajes y elementos de Navarra.
